import React from "react";
import "./Pages.css";

export default function About() {
  return (
    <section className="page about-page">
      <h1>About Us</h1>
      <p>
        Aki Battery Materials is a joint venture between Three Fires Group (TFG) and Electra,
        focused on localizing battery waste recycling in Ontario, supporting First Nations communities,
        and reducing carbon footprint by recovering critical minerals for EV batteries.
      </p>
    </section>
  );
}
